import React, { useEffect, useState } from "react";

const PrivacyPolicy = () => {
  const [privacyContent, setPrivacyContent] = useState("");

  useEffect(() => {
    // Fetch the privacy.html content or load it using any method you prefer
    fetch("privacy.html")  // Update the path accordingly
      .then(response => response.text())
      .then(data => setPrivacyContent(data))
      .catch(error => console.error("Error fetching privacy.html:", error));
  }, []);

  return (
    <div>
      <h1>Privacy Policy</h1>
      <div dangerouslySetInnerHTML={{ __html: privacyContent }}></div> {/* Add this line */}
    </div>
  );
};

export default PrivacyPolicy;
